import sys
import math
from collections import defaultdict

def candidate_func(input_str):
    input_data = input_str.split()
    N = int(input_data[0])
    K = int(input_data[1])
    A = list(map(int, input_data[2:]))

    def gcd(x, y):
        while y:
            x, y = y, x % y
        return x

    def gcd_of_list(lst):
        result = lst[0]
        for num in lst[1:]:
            result = gcd(result, num)
        return result

    def max_gcd_excluding_index(exclude_index):
        gcd_count = defaultdict(int)
        for i in range(N):
            if i == exclude_index:
                continue
            for j in range(1, int(A[i]**0.5) + 1):
                if A[i] % j == 0:
                    gcd_count[j] += 1
                    if j != A[i] // j:
                        gcd_count[A[i] // j] += 1

        max_gcd = 0
        for g, count in gcd_count.items():
            if count >= K - 1:
                max_gcd = max(max_gcd, g)

        return max_gcd

    results = []
    for i in range(N):
        results.append(max_gcd_excluding_index(i))

    return '\n'.join(map(str, results))
